import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [insertKey, setInsertKey] = useState('');
  const [insertValue, setInsertValue] = useState('');
  const [deleteKey, setDeleteKey] = useState('');
  const [searchKey, setSearchKey] = useState('');
  const [searchResult, setSearchResult] = useState(null);
  const [notification, setNotification] = useState('');
  const [loading, setLoading] = useState(false);

  const handleInsert = async (e) => {
    e.preventDefault();
    if (!insertKey || !insertValue) {
      setNotification('Key and Value must be provided for insertion.');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post('http://127.0.0.1:5000/extendible/insert', {
        key: parseInt(insertKey),
        value: insertValue,
      });
      if (response.data.success) {
        setNotification(`Inserted (${insertKey}, ${insertValue}) successfully!`);
        setInsertKey('');
        setInsertValue('');
      } else {
        setNotification(response.data.error);
      }
    } catch (error) {
      setNotification('Error inserting data: ' + error.message);
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (e) => {
    e.preventDefault();
    if (!deleteKey) {
      setNotification('Key must be provided for deletion.');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.delete(`http://127.0.0.1:5000/extendible/delete?key=${deleteKey}`);
      if (response.data.success) {
        setNotification(`Deleted key ${deleteKey} successfully!`);
        setDeleteKey('');
      } else {
        setNotification(response.data.error);
      }
    } catch (error) {
      setNotification('Error deleting data: ' + error.message);
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = async (e) => {
    e.preventDefault();
    if (!searchKey) {
      setNotification('Key must be provided for search.');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.get(`http://127.0.0.1:5000/extendible/search?key=${searchKey}`);
      if (response.data.success) {
        setSearchResult(response.data.message);
        setNotification(`Found key ${searchKey}: ${response.data.message}`);
        setSearchKey('');
      } else {
        setNotification(response.data.error);
      }
    } catch (error) {
      setNotification('Error searching data: ' + error.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <h1>Hashing</h1>

      <h2>Insert</h2>
      <form onSubmit={handleInsert}>
        <input
          type="number"
          placeholder="Key"
          value={insertKey}
          onChange={(e) => setInsertKey(e.target.value)}
        />
        <input
          type="text"
          placeholder="Value"
          value={insertValue}
          onChange={(e) => setInsertValue(e.target.value)}
        />
        <button type="submit" disabled={loading}>
          {loading ? 'Inserting...' : 'Insert'}
        </button>
      </form>

      <h2>Delete</h2>
      <form onSubmit={handleDelete}>
        <input
          type="number"
          placeholder="Key"
          value={deleteKey}
          onChange={(e) => setDeleteKey(e.target.value)}
        />
        <button type="submit" disabled={loading}>
          {loading ? 'Deleting...' : 'Delete'}
        </button>
      </form>

      <h2>Search</h2>
      <form onSubmit={handleSearch}>
        <input
          type="number"
          placeholder="Key"
          value={searchKey}
          onChange={(e) => setSearchKey(e.target.value)}
        />
        <button type="submit" disabled={loading}>
          {loading ? 'Searching...' : 'Search'}
        </button>
      </form>

      {notification && (
        <div className="notification">
          {notification}
          <button onClick={() => setNotification('')}>Close</button>
        </div>
      )}

      {searchResult && (
        <div className="search-result">
          <h2>Search Result</h2>
          <p>{searchResult}</p>
          <button onClick={() => setSearchResult(null)}>Clear</button>
        </div>
      )}
    </div>
  );
}

export default App;
